348	1	6	MIW Ethernet Fabric - R188/R189 change to 1K to fix position ID problem	The POSITION\\_ID0 and POSITION\\_ID1 bits are designed to pull a floating signal down via a 10K resistor. The signals must be pulled up by a device. The blade can be configured with a 100K pull-up and works with a single blade. However, if all blades are configured with a 100K pull-up, it effectively becomes a strong pull-up and the switch&#39;s 10K resistor is insufficient to pull the signal down.\n\n8 blades with 100k pullups in parallel: 1/(8\\*1/100000) = 12.5K pull-up.   \nA 12.5K pull-up vs a 10K pull down results in the 3.3V pull-up falling to ~1.47V. According to the i.mx7D manual, a the threshold for a high input should be no less than 0.7\\*VDD = 2.31V\n\nThe low input max is 0.3 x VDD = 0.99V so the value is in this middle/gray range where the behavior is not well defined.  \n  \nWith the MSOM as well, this problem is worse. \n\nThe hardware fix is to replace R188 and R189 with 1K (instead of the 10K they currently have).  \n  \n\n<figure class="image op-uc-figure" style="width:47.51%;"><div class="op-uc-figure--content"><img class="op-uc-image" src="/api/v3/attachments/5/content"></div></figure>\n\n  \n\nRework Instructions	\N	\N	1	\N	8	\N	5	0	\N	2021-07-22	\N	\N	\N	\N	\N	\N	f	\N	t	\N
