518	1	6	MIW - Kynetics would like to access the GPIO value from UBOOT.	From Diego @ Kynetics -\n\n&quot;We also have a lower priority request. We tried to setup the `MANAGE_SOM` GPIO in U-Boot, but we haven&#39;t been able to get it to work. Can you provide a reference patch for that? We don&#39;t need the `POSITION_ID` from U-Boot, just the `MANAGE_SOM` . Thanks&quot;\n\n<mention class="mention" data-id="8" data-type="user" data-text="@Andrew Moore">@Andrew Moore</mention> They are trying to use one of the GPIOs to determine which image to boot. For that they need to configure the pin in uboot, similar to what you did in the DTS. Specifically they are wanting us to provide a patch to uboot to get the pin configured. I think they are planning to then query it from a boot script to determine which image they need to boot. The MANAGE\\_SOM bit is just like the other POSITION\\_ID bits, the only difference is that it should be configured with the strong 5.7K pull up instead of the 100K value that we use on the other positions.\n\n<mention class="mention" data-id="8" data-type="user" data-text="@Andy Moore">@Andy Moore</mention> It would take a couple resistors to wire it up in the same fashion. Just to clarify, there are 9 slots for blades, one of which is dedicated for the management blade (aka MSOM). \n\nOn the non management blade slots, the pin is connected to a 330R pull-down resistor. On the management slot, that pin connects to a 100K pull-down but also routes to the microcontroller which is supposed to be able to read the state of the pin. The MCU should not interfere with the state of the pin at all as its configured as an input (ie high impedance).\n\nGenerally speaking, this pin should therefore be no different than the other GPIOs like the POSITION\\_ID pins. The only difference is that we want to use a stronger (5.7K) pull-down instead of of the 100k pull-ups that we configured on the other pins. \n\n  \n\nOne thing we should test is configuring that pin from the device tree and seeing if we can properly detect its state from linux. Then at least we can know that it is capable of being correct. Then the issue would likely just be in the uboot configuration.	\N	\N	1	8	7	\N	5	0	\N	2021-07-22	\N	\N	\N	\N	\N	\N	f	\N	t	\N
